import { useNavigate } from 'react-router-dom';
import css from './GetStarted.module.css';
import { useState } from 'react';
import TikTokUserDetails from 'Api/TikTokUserDetails';

const GetStarted = () => {
  const navigate = useNavigate();

  const handleUserSelect = (uniqueId, productType) => {
    if (productType === 'likes') {
      navigate('/tikTokLikes/selectPost', { state: { uniqueId } });
    } else if (productType === 'views') {
      navigate('/tikTokViews/selectPost', { state: { uniqueId } });
    } else {
      navigate('/tikTokFollowers/selectPost', { state: { uniqueId } });
    }
  };

  const [userInfo, setUserInfo] = useState(null);

  return (
    <>
      <div className={css.getStartedWrap}>
        {/* Ваш остальной код */}
        {userInfo &&
          userInfo.map(({ profile_pic_url, full_name, id, uniqueId }) => (
            <div key={id} className={css.findedUserWrap}>
              <img
                className={css.findedUserImage}
                src={profile_pic_url}
                alt="profile"
              />
              <div className={css.findedUserName}>{full_name}</div>
              <button
                className={css.getStartedRedirect}
                onClick={() => handleUserSelect(uniqueId, 'likes')}
              >
                Select
              </button>
            </div>
          ))}
      </div>
    </>
  );
};

export default GetStarted;
